import { Button } from "@material-ui/core";
import React from "react";
import { Link } from "react-router-dom";

const Option = () => {
  return (
    <>
      <Link to="/">
        <Button> <span>Тест по java</span> </Button>
        <Button> <span></span> </Button>
      </Link>
    </>
  );
};

export default Option;
